description:
A well fed dog is a fast dog.
Remember this, and your team will be unstoppable.

With a dogsledding team of your very own, enter randomized races to earn money so you can climb to higher leagues, buy new gear, build reputation, and hire dogs, whose skills will grow if they're treated right.

Dog Sled Saga has simple, pick-up-and-play interaction, but also deep systems for dedicated players to uncover. Race with your unique team of dogs. Each dog's speed is hindered by hunger. Lob a limited supply of food to them to keep at full speed. Hazards on the track await.

